  true,\n\t\"url\": null,\n\t\"notes\": \"The Emergency Food Assistance Program (TEFAP)
  is a U.S. Department of Agriculture (USDA) program that for three decades has helped
  supplement the diets of low-income Americans, including seniors, by providing them
  with emergency food and nutrition assistance at no cost. This white paper explains
  the program and describes some of its key results.\",\n\t\"license_title\": \"Creative
